import React, { Component } from 'react'
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'
import Home from './Home'
class App extends Component {
  render() {
    return (
      <Router>
        <Route path='/' component={Home} />
      </Router>
    )
  }
}

